// go test -bench=.

package research_sring_concat_benchmark

import (
	"bytes"
	"testing"
)

const testString = "test"

func BenchmarkConcat(b *testing.B) {
	var str string
	b.ResetTimer()
	for n := 0; n < b.N; n++ {
		str += testString
	}
	b.StopTimer()
}

func BenchmarkBuffer(b *testing.B) {
	var buffer bytes.Buffer

	b.ResetTimer()
	for n := 0; n < b.N; n++ {
		buffer.WriteString(testString)
	}
	b.StopTimer()
}

func BenchmarkCopy(b *testing.B) {
	bs := make([]byte, b.N)
	bl := 0

	b.ResetTimer()
	for n := 0; n < b.N; n++ {
		bl += copy(bs[bl:], testString)
	}
	b.StopTimer()
}

func BenchmarkCompare(b *testing.B) {
	s1 := ""
	s2 := ""

	b.ResetTimer()
	i := 0
	for n := 0; n < b.N; n++ {
		if s2 == "" {
			i++
		}
		if s1 == "" {
			i++
		}
	}
	b.StopTimer()
}

func BenchmarkCompareLen(b *testing.B) {
	s1 := ""
	s2 := ""

	b.ResetTimer()
	i := 0
	for n := 0; n < b.N; n++ {
		if len(s2) > 0 {
			i++
		}
		if len(s1) > 0 {
			i++
		}
	}
	b.StopTimer()
}

